            if do_trace_tagging:
                ts_exit = datetime.now()
                ctrl_msg.set_timestamp(f"trace::exit::{self._task_desc}", ts_exit)
                ctrl_msg.set_timestamp("latency::ts_send", ts_exit)
            return ctrl_msg

        return merge_fn

